const data = {
  type: "dark",
  primary: {
    main: "#0f0",
    light: "#007168",
  },
  secondary: {
    main: "#ff0080",
  },
  info: {
    main: "#2196f3",
  },
  error: {
    main: "#fd0105",
  },
  neutral: {
    main: "#2979ff",
    dark: "#37474f",
    straight: "#000000",
    reverse: "#ffffff",
    brown: "rgba(135, 91, 53, 0.2)",
  },
  background: {
    default: "#192231",
    paper: "#24344d",
  },
};

export default data;
